import React from "react";
import './Login.css';
import { Link } from "react-router-dom";




function Login() {
 
const a =document.documentElement;
function openFullscreen() {
  if (!a.requestFullscreen) {
    a.requestFullscreen();
  } else if (a.webkitRequestFullscreen) { /* Safari */
    a.webkitRequestFullscreen();
  } else if (a.msRequestFullscreen) { /* IE11 */
    a.msRequestFullscreen();
  }
}
function closeFullscreen() {
  if (document.exitFullscreen) {
    document.exitFullscreen();
  } else if (document.webkitExitFullscreen) { /* Safari */
    document.webkitExitFullscreen();
  } else if (document.msExitFullscreen) { /* IE11 */
    document.msExitFullscreen();
  }
}

  return (
    <div className="Login">
      <form className="formlogin">
        <input type="email" placeholder="E-mail" />
        <br />
        <input type="password" placeholder="Password" />
        <br />
        
          <Link className="Link" to='/Main' ><button>Login</button></Link>
          <button onClick={(p)=>{openFullscreen();}} ></button>
          <button onClick={(p)=>{  closeFullscreen();}} ></button>
      </form>
    
    </div>

  );
}

export default Login;
